// Search.js
import React, { useState } from "react";
import "./Search.css";

export default function Search({ onSearch }) {
  const [searchCriteria, setSearchCriteria] = useState({
    make: "",
    model: "",
    year: "",
    state: "",
    car_condition: "",
    sales_category: "",
    body_type: "",
    fuel_type: "",
    engine: "",
    transmission: "",
    odometer: "",
    sale_date: "",
    custom_date: "",
    badges: "",
    cylinders: "",
    division: "",
    drive: "",
    seats: "",
    doors: ""
  });

  const [showMoreFilters, setShowMoreFilters] = useState(false);

  const options = {
    make: ["Audi", "BMW", "Mercedes", "Toyota"],
    model: ["A5", "A6","X5", "C-Class", "Camry"],
    year: ["2015", "2016", "2017", "2018"],
    state: ["Victoria", "New South Wales", "Western Australia", "Tasmania", "Queensland", "South Australia", "Australian Capital Territory"],
    car_condition: ["New", "Used", "Certified Pre-Owned"],
    sales_category: ["Private", "Dealer"],
    body_type: ["Sedan", "Sportback", "SUV", "Truck"],
    fuel_type: ["Gasoline", "Diesel", "Electric", "Hybrid"],
    engine: ["2.0 Turbo", "3.0 V6", "4.0 V8"],
    transmission: ["Automatic", "Manual"],
    odometer: ["0-50k", "50k-100k", "100k-150k","150k+"],
    sale_date: ["Last Week", "Last Month", "Last Year"],
    custom_date: ["2024-02-07", "2024-01-01", "2023-12-01"],
    badges: ["Quattro", "M Performance", "AMG"],
    cylinders: ["4", "6", "8"],
    division: ["Luxury", "Sports", "Economy"],
    drive: ["FWD", "RWD", "AWD"],
    seats: ["2", "4", "5", "7"],
    doors: ["2", "4", "5"]
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setSearchCriteria({
      ...searchCriteria,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const filteredCriteria = Object.fromEntries(
      Object.entries(searchCriteria).filter(([_, value]) => value !== "")
    );

    if (filteredCriteria.odometer) {
      console.log("Raw odometer value:", filteredCriteria.odometer); // 调试

      const range = filteredCriteria.odometer.match(/\d+/g); // 仅提取数字部分
      console.log("Parsed range:", range); // 调试

      if (range) {
        if (range.length === 2) {
          filteredCriteria.odometer_min = parseInt(range[0], 10) * 1000;
          filteredCriteria.odometer_max = parseInt(range[1], 10) * 1000;
        } else if (range.length === 1) {
          filteredCriteria.odometer_min = parseInt(range[0], 10) * 1000;
        }
      }

    //   console.log("Final odometer_min:", filteredCriteria.odometer_min); 
    //   console.log("Final odometer_max:", filteredCriteria.odometer_max);
      delete filteredCriteria.odometer;
    }

    onSearch(filteredCriteria);
  };


  const handleReset = () => {
    setSearchCriteria({
      make: "",
      model: "",
      year: "",
      state: "",
      car_condition: "",
      sales_category: "",
      body_type: "",
      fuel_type: "",
      engine: "",
      transmission: "",
      odometer: "",
      sale_date: "",
      custom_date: "",
      badges: "",
      cylinders: "",
      division: "",
      drive: "",
      seats: "",
      doors: ""
    });
    onSearch({});
  };

  const criteriaKeys = Object.keys(searchCriteria);
  const visibleFields = showMoreFilters ? criteriaKeys : criteriaKeys.slice(0, 8);

  const groupedFields = [];
  for (let i = 0; i < visibleFields.length; i += 4) {
    groupedFields.push(visibleFields.slice(i, i + 4));
  }

// code for submit handleSubmit
  return (
    <div className="search-container">
      <h2>Car Search</h2>
      <form onSubmit={handleSubmit}>
        <div className="search-fields">
          {groupedFields.map((row, rowIndex) => (
            <div className="search-row" key={rowIndex}>
              {row.map((key) => (
                <div className="search-field" key={key}>
                  <label>{key.replace(/([A-Z])/g, ' $1').replace(/^./, str => str.toUpperCase())}</label>
                  <select 
                    name={key} 
                    value={searchCriteria[key]} 
                    onChange={handleInputChange} 
                    className="search-select"
                  >
                    <option value="">Select {key}</option>
                    {options[key] && options[key].map((option) => (
                      <option key={option} value={option}>{option}</option>
                    ))}
                  </select>
                </div>
              ))}
            </div>
          ))}
        </div>
        <div className="button-group">
          <button 
            type="button" 
            className="more-filters-button" 
            onClick={() => setShowMoreFilters(!showMoreFilters)}
          >
            {showMoreFilters ? "Show Less Filters" : "More Filters"}
          </button>
          <button 
            type="button" 
            className="reset-button" 
            onClick={handleReset}
          >
            Reset Filters
          </button>
          <button type="submit" className="search-button">
            Search
          </button>
        </div>
      </form>
    </div>
  );
}
